Considerando a realização da Dispensa Eletrônica nº 90002/2025, informa-se que os seguintes itens restaram fracassados, não obtendo propostas válidas ou aceitáveis durante o certame:
Item 6 – Guardanapo de papel;
Item 7 – Inseticida;
Item 9 – Desodorizador de ar;
Item 12 – Papel higiênico;
Item 16 – Varal de chão para roupas.
Diante da necessidade de aquisição desses materiais e da ausência de propostas aptas na licitação, foi identificada a proposta mais vantajosa de fornecedor estabelecido na mesma localidade da Administração, escolhido entre os fornecedores que forneceram valores na pesquisa de preços durante o processo de compra, de forma a garantir o atendimento da demanda existente do órgão e a melhor oferta compatível com os valores praticados no mercado.
